import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const NewEntry = () => {
    return (
        <Row>
            <Col>
                <div className="card">
                    <div>New Entry</div>
                </div>
            </Col>
        </Row>
    )
}

export default NewEntry;
